    XW += x[19]*31.998800; /*O2 */
    XW += x[20]*33.006770; /*HO2 */
    XW += x[21]*34.014740; /*H2O2 */
    XW += x[22]*44.009950; /*CO2 */
    XW += x[23]*44.053580; /*CH3HCO */
    XW += x[24]*45.061550; /*CH3OCH2 */
    XW += x[25]*46.025890; /*HCOOH */
    XW += x[26]*46.069520; /*CH3OCH3 */
