    XW += x[28]*59.045010; /*CH3OCO */
    XW += x[29]*60.052980; /*CH3OCHO */
    XW += x[30]*61.060950; /*CH3OCH2O */
    XW += x[31]*62.068920; /*CH3OCH2OH */
    XW += x[32]*75.044410; /*OCH2OCHO */
    XW += x[33]*75.044410; /*HOCH2OCO */
