/*Compute rho = P*W(y)/RT */
void CKRHOY(double * restrict  P, double * restrict  T, double * restrict  y, int * iwrk, double * restrict  rwrk, double * restrict  rho)
{
    double YOW = 0;
    double tmp[39];

    for (int i = 0; i < 39; i++)
    {
        tmp[i] = y[i]*imw[i];
    }
    for (int i = 0; i < 39; i++)
    {
        YOW += tmp[i];
    }

    *rho = *P / (83145100 * (*T) * YOW);/*rho = P*W/(R*T) */
    return;
}


