/*given c[species]: molar concentration */
/*returns mean molecular weight (gm/mole) */
void CKMMWC(double * restrict c, int * iwrk, double * restrict  rwrk, double * restrict  wtm)
{
    int id; /*loop counter */
    /*See Eq 5 in CK Manual */
    double W = 0;
    double sumC = 0;
    W += c[0]*1.007970; /*H */
    W += c[1]*2.015940; /*H2 */
    W += c[2]*14.027090; /*CH2 */
    W += c[3]*14.027090; /*CH2(S) */
    W += c[4]*15.035060; /*CH3 */
    W += c[5]*15.999400; /*O */
    W += c[6]*16.043030; /*CH4 */
    W += c[7]*17.007370; /*OH */
    W += c[8]*18.015340; /*H2O */
    W += c[9]*26.038240; /*C2H2 */
    W += c[10]*27.046210; /*C2H3 */
    W += c[11]*28.010550; /*CO */
    W += c[12]*28.054180; /*C2H4 */
    W += c[13]*29.018520; /*HCO */
    W += c[14]*29.062150; /*C2H5 */
    W += c[15]*30.026490; /*CH2O */
    W += c[16]*30.070120; /*C2H6 */
    W += c[17]*31.034460; /*CH2OH */
    W += c[18]*31.034460; /*CH3O */
    W += c[19]*31.998800; /*O2 */
    W += c[20]*33.006770; /*HO2 */
    W += c[21]*34.014740; /*H2O2 */
    W += c[22]*44.009950; /*CO2 */
    W += c[23]*44.053580; /*CH3HCO */
    W += c[24]*45.061550; /*CH3OCH2 */
    W += c[25]*46.025890; /*HCOOH */
    W += c[26]*46.069520; /*CH3OCH3 */
    W += c[27]*47.033860; /*HOCH2O */
    W += c[28]*59.045010; /*CH3OCO */
    W += c[29]*60.052980; /*CH3OCHO */
    W += c[30]*61.060950; /*CH3OCH2O */
    W += c[31]*62.068920; /*CH3OCH2OH */
    W += c[32]*75.044410; /*OCH2OCHO */
    W += c[33]*75.044410; /*HOCH2OCO */
    W += c[34]*77.060350; /*CH3OCH2O2 */
    W += c[35]*77.060350; /*CH2OCH2O2H */
    W += c[36]*92.051780; /*HO2CH2OCHO */
    W += c[37]*109.059150; /*O2CH2OCH2O2H */
    W += c[38]*28.013400; /*N2 */

    for (id = 0; id < 39; ++id) {
        sumC += c[id];
    }
    /* CK provides no guard against divison by zero */
    *wtm = W/sumC;

    return;
}


/*convert y[species] (mass fracs) to x[species] (mole fracs) */
void CKYTX(double * restrict  y, int * iwrk, double * restrict  rwrk, double * restrict  x)
{
    double YOW = 0;
    double tmp[39];

    for (int i = 0; i < 39; i++)
    {
        tmp[i] = y[i]*imw[i];
    }
    for (int i = 0; i < 39; i++)
    {
        YOW += tmp[i];
    }

    double YOWINV = 1.0/YOW;

    for (int i = 0; i < 39; i++)
    {
        x[i] = y[i]*imw[i]*YOWINV;
    }
    return;
}


/*convert y[npoints*species] (mass fracs) to x[npoints*species] (mole fracs) */
void VCKYTX(int * restrict np, double * restrict  y, int * iwrk, double * restrict  rwrk, double * restrict  x)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<39; n++) {
        for (int i=0; i<(*np); i++) {
            x[n*(*np)+i] = y[n*(*np)+i] * imw[n];
            YOW[i] += x[n*(*np)+i];
        }
    }

    for (int i=0; i<(*np); i++) {
        YOW[i] = 1.0/YOW[i];
    }

    for (int n=0; n<39; n++) {
        for (int i=0; i<(*np); i++) {
            x[n*(*np)+i] *=  YOW[i];
        }
    }
}


/*convert y[species] (mass fracs) to c[species] (molar conc) */
void CKYTCP(double * restrict  P, double * restrict  T, double * restrict  y, int * iwrk, double * restrict  rwrk, double * restrict  c)
{
    double YOW = 0;
    double PWORT;

    /*Compute inverse of mean molecular wt first */
    for (int i = 0; i < 39; i++)
    {
        c[i] = y[i]*imw[i];
    }
    for (int i = 0; i < 39; i++)
    {
        YOW += c[i];
    }

    /*PW/RT (see Eq. 7) */
    PWORT = (*P)/(YOW * 8.31451e+07 * (*T)); 
    /*Now compute conversion */

    for (int i = 0; i < 39; i++)
    {
        c[i] = PWORT * y[i] * imw[i];
    }
    return;
}


/*convert y[species] (mass fracs) to c[species] (molar conc) */
void CKYTCR(double * restrict  rho, double * restrict  T, double * restrict  y, int * iwrk, double * restrict  rwrk, double * restrict  c)
{
    for (int i = 0; i < 39; i++)
    {
        c[i] = (*rho)  * y[i] * imw[i];
    }
}


