    x[18] = y[18]/(31.034460*YOW); 
    x[19] = y[19]/(31.998800*YOW); 
    x[20] = y[20]/(33.006770*YOW); 
    x[21] = y[21]/(34.014740*YOW); 
    x[22] = y[22]/(44.009950*YOW); 
    x[23] = y[23]/(44.053580*YOW); 
    x[24] = y[24]/(45.061550*YOW); 
    x[25] = y[25]/(46.025890*YOW); 
