    XW += x[0]*1.007970; /*H */
    XW += x[1]*2.015940; /*H2 */
    XW += x[2]*14.027090; /*CH2 */
    XW += x[3]*14.027090; /*CH2(S) */
    XW += x[4]*15.035060; /*CH3 */
    XW += x[5]*15.999400; /*O */
    XW += x[6]*16.043030; /*CH4 */
    XW += x[7]*17.007370; /*OH */
    XW += x[8]*18.015340; /*H2O */
    XW += x[9]*26.038240; /*C2H2 */
