    /*reaction 15: HO2 + HO2 <=> H2O2 + O2 */
    a[14] = 1.3e+11;
    b[14] = 0;
    e[14] = -1629.3;

    /*reaction 16: H2O2 (+M) <=> OH + OH (+M) */
    a[15] = 2.951e+14;
    b[15] = 0;
    e[15] = 48430;

    /*reaction 17: H2O2 + H <=> H2O + OH */
    a[16] = 2.41e+13;
