        qdot = q_f - q_r;
        wdot[5*npt+i] -= 1 * qdot;
        wdot[1*npt+i] -= 1 * qdot;
        wdot[0*npt+i] += 1 * qdot;
        wdot[7*npt+i] += 1 * qdot;

        /*reaction 3: H2 + OH <=> H2O + H */
        phi_f = sc[1*npt+i]*sc[7*npt+i];
        k_f = k_f_s[2][i];
        q_f = phi_f * k_f;
        phi_r = sc[8*npt+i]*sc[0*npt+i];
        Kc = Kc_s[2][i];
        k_r = k_f / Kc;
        q_r = phi_r * k_r;
        qdot = q_f - q_r;
        wdot[1*npt+i] -= 1 * qdot;
        wdot[7*npt+i] -= 1 * qdot;
        wdot[8*npt+i] += 1 * qdot;
        wdot[0*npt+i] += 1 * qdot;

        /*reaction 4: O + H2O <=> OH + OH */
        phi_f = sc[5*npt+i]*sc[8*npt+i];
        k_f = k_f_s[3][i];
        q_f = phi_f * k_f;
        phi_r = sc[7*npt+i]*sc[7*npt+i];
