        qdot = q_f - q_r;
        wdot[5*npt+i] -= 1 * qdot;
        wdot[8*npt+i] -= 1 * qdot;
        wdot[7*npt+i] += 1 * qdot;
        wdot[7*npt+i] += 1 * qdot;

        /*reaction 5: H2 + M <=> H + H + M */
        phi_f = sc[1*npt+i];
        alpha = mixture[i] + 1.5*sc[1*npt+i] + 11*sc[8*npt+i] + 0.9*sc[11*npt+i] + 2.8*sc[22*npt+i];
        k_f = alpha * k_f_s[4][i];
