        q_r = phi_r * k_r;
        qdot = q_f - q_r;
        wdot[1*npt+i] -= 1 * qdot;
        wdot[0*npt+i] += 1 * qdot;
        wdot[0*npt+i] += 1 * qdot;

        /*reaction 6: O + O + M <=> O2 + M */
        phi_f = sc[5*npt+i]*sc[5*npt+i];
        alpha = mixture[i] + 1.5*sc[1*npt+i] + 11*sc[8*npt+i] + 0.9*sc[11*npt+i] + 2.8*sc[22*npt+i];
        k_f = alpha * k_f_s[5][i];
        q_f = phi_f * k_f;
        phi_r = sc[19*npt+i];
        Kc = Kc_s[5][i];
        k_r = k_f / Kc;
        q_r = phi_r * k_r;
