        wdot[5*npt+i] -= 1 * qdot;
        wdot[5*npt+i] -= 1 * qdot;
        wdot[19*npt+i] += 1 * qdot;

        /*reaction 7: O + H + M <=> OH + M */
        phi_f = sc[5*npt+i]*sc[0*npt+i];
