    phi_f[0] = sc[0]*sc[19];
    phi_r[0] = sc[5]*sc[7];
    Kc[0] = exp((g_RT[0] + g_RT[19]) - (g_RT[5] + g_RT[7]));
    dlnKcdT[0] = invT * (-(h_RT[0] + h_RT[19]) + (h_RT[5] + h_RT[7]));
