    Kc[174] = refC * exp((g_RT[25] + g_RT[5]) - (g_RT[11] + g_RT[7] + g_RT[7]));
    dlnKcdT[174] = invT * (-(h_RT[25] + h_RT[5]) + (h_RT[11] + 2*h_RT[7]) - 1);

    for (int i=0; i<175; ++i) {
        Ri = &(R[i]);
        k_f[i] = Ri->prefactor_units * Ri->fwd_A * exp(Ri->fwd_beta * tc[0] - Ri->activation_units * Ri->fwd_Ea * invT);
        dlnkfdT[i] = Ri->fwd_beta * invT + Ri->activation_units * Ri->fwd_Ea * invT2;
        k_r[i] = k_f[i] / Kc[i];
        dkrdT[i] = (dlnkfdT[i] - dlnKcdT[i])*k_r[i];
        k_0[i] = (Ri->is_PD ? Ri->low_A * exp(Ri->low_beta * tc[0] - Ri->activation_units * Ri->low_Ea * invT) : 0);
    }

    /*reaction 1: H + O2 <=> O + OH */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[0]);
    /* rate of progress */
    q = k_f[0]*phi_f[0] - k_r[0]*phi_r[0];
    dqdT = dlnkfdT[0]*k_f[0]*phi_f[0] - dkrdT[0]*phi_r[0];
    /* update wdot */
    wdot[0] -= q; /* H */
    wdot[5] += q; /* O */
    wdot[7] += q; /* OH */
    wdot[19] -= q; /* O2 */
    /* d()/d[H] */
    dqdci =  + k_f[0] *sc[19];
    J[0] += -1 * dqdci;           /* dwdot[H]/d[H] */
    J[5] += 1 * dqdci;            /* dwdot[O]/d[H] */
    J[7] += 1 * dqdci;            /* dwdot[OH]/d[H] */
    J[19] += -1 * dqdci;          /* dwdot[O2]/d[H] */
    /* d()/d[O] */
    dqdci =  - k_r[0]*sc[7];
    J[200] += -1 * dqdci;         /* dwdot[H]/d[O] */
    J[205] += 1 * dqdci;          /* dwdot[O]/d[O] */
    J[207] += 1 * dqdci;          /* dwdot[OH]/d[O] */
    J[219] += -1 * dqdci;         /* dwdot[O2]/d[O] */
    /* d()/d[OH] */
    dqdci =  - k_r[0]*sc[5];
    J[280] += -1 * dqdci;         /* dwdot[H]/d[OH] */
    J[285] += 1 * dqdci;          /* dwdot[O]/d[OH] */
    J[287] += 1 * dqdci;          /* dwdot[OH]/d[OH] */
    J[299] += -1 * dqdci;         /* dwdot[O2]/d[OH] */
    /* d()/d[O2] */
    dqdci =  + k_f[0] *sc[0];
    J[760] += -1 * dqdci;         /* dwdot[H]/d[O2] */
    J[765] += 1 * dqdci;          /* dwdot[O]/d[O2] */
    J[767] += 1 * dqdci;          /* dwdot[OH]/d[O2] */
    J[779] += -1 * dqdci;         /* dwdot[O2]/d[O2] */
    /* d()/dT */
    J[1560] += -1 * dqdT;         /* dwdot[H]/dT */
    J[1565] += 1 * dqdT;          /* dwdot[O]/dT */
    J[1567] += 1 * dqdT;          /* dwdot[OH]/dT */
    J[1579] += -1 * dqdT;         /* dwdot[O2]/dT */

    /*reaction 2: O + H2 <=> H + OH */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[1]);
