    q = k_f[1]*phi_f[1] - k_r[1]*phi_r[1];
    dqdT = dlnkfdT[1]*k_f[1]*phi_f[1] - dkrdT[1]*phi_r[1];
    /* update wdot */
    wdot[0] += q; /* H */
    wdot[1] -= q; /* H2 */
    wdot[5] -= q; /* O */
    wdot[7] += q; /* OH */
