    J[1560] += 1 * dqdT;          /* dwdot[H]/dT */
    J[1561] += -1 * dqdT;         /* dwdot[H2]/dT */
    J[1565] += -1 * dqdT;         /* dwdot[O]/dT */
    J[1567] += 1 * dqdT;          /* dwdot[OH]/dT */

