    wdot[0] += q; /* H */
    wdot[1] -= q; /* H2 */
    wdot[7] -= q; /* OH */
    wdot[8] += q; /* H2O */
    /* d()/d[H] */
    dqdci =  - k_r[2]*sc[8];
    J[0] += 1 * dqdci;            /* dwdot[H]/d[H] */
    J[1] += -1 * dqdci;           /* dwdot[H2]/d[H] */
    J[7] += -1 * dqdci;           /* dwdot[OH]/d[H] */
    J[8] += 1 * dqdci;            /* dwdot[H2O]/d[H] */
