    J[41] += -1 * dqdci;          /* dwdot[H2]/d[H2] */
    J[47] += -1 * dqdci;          /* dwdot[OH]/d[H2] */
    J[48] += 1 * dqdci;           /* dwdot[H2O]/d[H2] */
