    J[281] += -1 * dqdci;         /* dwdot[H2]/d[OH] */
    J[287] += -1 * dqdci;         /* dwdot[OH]/d[OH] */
    J[288] += 1 * dqdci;          /* dwdot[H2O]/d[OH] */
