    dqdci =  - k_r[2]*sc[0];
    J[320] += 1 * dqdci;          /* dwdot[H]/d[H2O] */
    J[321] += -1 * dqdci;         /* dwdot[H2]/d[H2O] */
    J[327] += -1 * dqdci;         /* dwdot[OH]/d[H2O] */
    J[328] += 1 * dqdci;          /* dwdot[H2O]/d[H2O] */
