        dqdc[24] = q_nocor;
        dqdc[25] = q_nocor;
        dqdc[26] = q_nocor;
        dqdc[27] = q_nocor;
        dqdc[28] = q_nocor;
        dqdc[29] = q_nocor;
        dqdc[30] = q_nocor;
        dqdc[31] = q_nocor;
        dqdc[32] = q_nocor;
        dqdc[33] = q_nocor;
        dqdc[34] = q_nocor;
        dqdc[35] = q_nocor;
        dqdc[36] = q_nocor;
        dqdc[37] = q_nocor;
        dqdc[38] = q_nocor;
