    J[1561] += -1 * dqdT; /* dwdot[H2]/dT */

    /*reaction 6: O + O + M <=> O2 + M */
    /*a third-body and non-pressure-fall-off reaction */
    Ri = &(R[5]);
    /* 3-body correction factor */
    alpha = mixture + 1.5*sc[1] + 11*sc[8] + 0.9*sc[11] + 2.8*sc[22];
