    /* d()/d[C2H6] */
    dqdci =  + k_f[83] *sc[20];
    J[654] += 1 * dqdci;          /* dwdot[C2H5]/d[C2H6] */
    J[656] += -1 * dqdci;         /* dwdot[C2H6]/d[C2H6] */
    J[660] += -1 * dqdci;         /* dwdot[HO2]/d[C2H6] */
    J[661] += 1 * dqdci;          /* dwdot[H2O2]/d[C2H6] */
    /* d()/d[HO2] */
    dqdci =  + k_f[83] *sc[16];
    J[814] += 1 * dqdci;          /* dwdot[C2H5]/d[HO2] */
    J[816] += -1 * dqdci;         /* dwdot[C2H6]/d[HO2] */
    J[820] += -1 * dqdci;         /* dwdot[HO2]/d[HO2] */
    J[821] += 1 * dqdci;          /* dwdot[H2O2]/d[HO2] */
    /* d()/d[H2O2] */
    dqdci =  - k_r[83]*sc[14];
    J[854] += 1 * dqdci;          /* dwdot[C2H5]/d[H2O2] */
    J[856] += -1 * dqdci;         /* dwdot[C2H6]/d[H2O2] */
    J[860] += -1 * dqdci;         /* dwdot[HO2]/d[H2O2] */
    J[861] += 1 * dqdci;          /* dwdot[H2O2]/d[H2O2] */
    /* d()/dT */
    J[1574] += 1 * dqdT;          /* dwdot[C2H5]/dT */
    J[1576] += -1 * dqdT;         /* dwdot[C2H6]/dT */
    J[1580] += -1 * dqdT;         /* dwdot[HO2]/dT */
    J[1581] += 1 * dqdT;          /* dwdot[H2O2]/dT */

    /*reaction 85: C2H6 + CH3 <=> C2H5 + CH4 */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[84]);
    /* rate of progress */
    q = k_f[84]*phi_f[84] - k_r[84]*phi_r[84];
    dqdT = dlnkfdT[84]*k_f[84]*phi_f[84] - dkrdT[84]*phi_r[84];
    /* update wdot */
    wdot[4] -= q; /* CH3 */
    wdot[6] += q; /* CH4 */
    wdot[14] += q; /* C2H5 */
    wdot[16] -= q; /* C2H6 */
    /* d()/d[CH3] */
    dqdci =  + k_f[84] *sc[16];
    J[164] += -1 * dqdci;         /* dwdot[CH3]/d[CH3] */
    J[166] += 1 * dqdci;          /* dwdot[CH4]/d[CH3] */
    J[174] += 1 * dqdci;          /* dwdot[C2H5]/d[CH3] */
    J[176] += -1 * dqdci;         /* dwdot[C2H6]/d[CH3] */
    /* d()/d[CH4] */
    dqdci =  - k_r[84]*sc[14];
    J[244] += -1 * dqdci;         /* dwdot[CH3]/d[CH4] */
    J[246] += 1 * dqdci;          /* dwdot[CH4]/d[CH4] */
    J[254] += 1 * dqdci;          /* dwdot[C2H5]/d[CH4] */
    J[256] += -1 * dqdci;         /* dwdot[C2H6]/d[CH4] */
    /* d()/d[C2H5] */
    dqdci =  - k_r[84]*sc[6];
    J[564] += -1 * dqdci;         /* dwdot[CH3]/d[C2H5] */
    J[566] += 1 * dqdci;          /* dwdot[CH4]/d[C2H5] */
    J[574] += 1 * dqdci;          /* dwdot[C2H5]/d[C2H5] */
    J[576] += -1 * dqdci;         /* dwdot[C2H6]/d[C2H5] */
    /* d()/d[C2H6] */
    dqdci =  + k_f[84] *sc[4];
    J[644] += -1 * dqdci;         /* dwdot[CH3]/d[C2H6] */
    J[646] += 1 * dqdci;          /* dwdot[CH4]/d[C2H6] */
    J[654] += 1 * dqdci;          /* dwdot[C2H5]/d[C2H6] */
    J[656] += -1 * dqdci;         /* dwdot[C2H6]/d[C2H6] */
    /* d()/dT */
    J[1564] += -1 * dqdT;         /* dwdot[CH3]/dT */
    J[1566] += 1 * dqdT;          /* dwdot[CH4]/dT */
    J[1574] += 1 * dqdT;          /* dwdot[C2H5]/dT */
    J[1576] += -1 * dqdT;         /* dwdot[C2H6]/dT */

    /*reaction 86: C2H5 + H (+M) <=> C2H6 (+M) */
    /*a pressure-fall-off reaction */
    Ri = &(R[85]);
    /* 3-body correction factor */
    alpha = mixture + sc[1] + 5*sc[8] + sc[6] + 0.5*sc[11] + sc[22] + 2*sc[16];
    /* pressure-fall-off */
    Pr = Ri->phase_units * alpha / k_f[85] * k_0[85];
    fPr = Pr / (1.0+Pr);
    dlnk0dT = Ri->low_beta * invT + Ri->activation_units * Ri->low_Ea * invT2;
    dlogPrdT = log10e*(dlnk0dT - dlnkfdT[85]);
    dlogfPrdT = dlogPrdT / (1.0+Pr);
    /* Troe form */
    logPr = log10(Pr);
    Fcent1 = (fabs(Ri->troe_Tsss) > 1.e-100 ? (1-Ri->troe_a)*exp(-T/Ri->troe_Tsss) : 0);
    Fcent2 = (fabs(Ri->troe_Ts) > 1.e-100 ? Ri->troe_a * exp(-T/Ri->troe_Ts) : 0);
    Fcent3 = (Ri->troe_len == 4 ? exp(-Ri->troe_Tss * invT) : 0);
    Fcent = Fcent1 + Fcent2 + (Ri->troe_len == 4 ? Fcent3 : 0);
    logFcent = log10(Fcent);
    troe_c = -.4 - .67 * logFcent;
    troe_n = .75 - 1.27 * logFcent;
    troePr_den = 1.0 / (troe_n - .14*(troe_c + logPr));
    troePr = (troe_c + logPr) * troePr_den;
    troe = 1.0 / (1.0 + troePr*troePr);
    F = pow(10.0, logFcent * troe);
    dlogFcentdT = log10e/Fcent*( (fabs(Ri->troe_Tsss) > 1.e-100 ? -Fcent1/Ri->troe_Tsss : 0) + (fabs(Ri->troe_Ts) > 1.e-100 ? -Fcent2/Ri->troe_Ts : 0) + (Ri->troe_len == 4 ? Fcent3*Ri->troe_Tss*invT2 : 0) );
    dlogFdcn_fac = 2.0 * logFcent * troe*troe * troePr * troePr_den;
    dlogFdc = -troe_n * dlogFdcn_fac * troePr_den;
    dlogFdn = dlogFdcn_fac * troePr;
    dlogFdlogPr = dlogFdc;
    dlogFdT = dlogFcentdT*(troe - 0.67*dlogFdc - 1.27*dlogFdn) + dlogFdlogPr * dlogPrdT;
    /* rate of progress */
    q_nocor = k_f[85]*phi_f[85] - k_r[85]*phi_r[85];
    Corr = fPr * F;
    q = Corr * q_nocor;
    dlnCorrdT = ln10*(dlogfPrdT + dlogFdT);
    dqdT = Corr * (dlnkfdT[85]*k_f[85]*phi_f[85] - dkrdT[85]*phi_r[85]) + dlnCorrdT*q;
    /* update wdot */
    wdot[0] -= q; /* H */
    wdot[14] -= q; /* C2H5 */
    wdot[16] += q; /* C2H6 */
    /* for convenience */
    k_f[85] *= Corr;
    k_r[85] *= Corr;
    dcdc_fac = q/alpha*(1.0/(Pr+1.0) + dlogFdlogPr);
    if (consP) {
        /* d()/d[H] */
        dqdci =  + k_f[85] *sc[14];
        J[0] += -1 * dqdci;           /* dwdot[H]/d[H] */
        J[14] += -1 * dqdci;          /* dwdot[C2H5]/d[H] */
        J[16] += 1 * dqdci;           /* dwdot[C2H6]/d[H] */
        /* d()/d[H2] */
        dqdci = dcdc_fac;
        J[40] += -1 * dqdci;          /* dwdot[H]/d[H2] */
        J[54] += -1 * dqdci;          /* dwdot[C2H5]/d[H2] */
        J[56] += 1 * dqdci;           /* dwdot[C2H6]/d[H2] */
        /* d()/d[CH4] */
        dqdci = dcdc_fac;
        J[240] += -1 * dqdci;         /* dwdot[H]/d[CH4] */
        J[254] += -1 * dqdci;         /* dwdot[C2H5]/d[CH4] */
        J[256] += 1 * dqdci;          /* dwdot[C2H6]/d[CH4] */
        /* d()/d[H2O] */
        dqdci =  5*dcdc_fac;
        J[320] += -1 * dqdci;         /* dwdot[H]/d[H2O] */
        J[334] += -1 * dqdci;         /* dwdot[C2H5]/d[H2O] */
        J[336] += 1 * dqdci;          /* dwdot[C2H6]/d[H2O] */
        /* d()/d[CO] */
        dqdci =  0.5*dcdc_fac;
        J[440] += -1 * dqdci;         /* dwdot[H]/d[CO] */
        J[454] += -1 * dqdci;         /* dwdot[C2H5]/d[CO] */
        J[456] += 1 * dqdci;          /* dwdot[C2H6]/d[CO] */
        /* d()/d[C2H5] */
        dqdci =  + k_f[85] *sc[0];
        J[560] += -1 * dqdci;         /* dwdot[H]/d[C2H5] */
        J[574] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H5] */
        J[576] += 1 * dqdci;          /* dwdot[C2H6]/d[C2H5] */
        /* d()/d[C2H6] */
        dqdci =  2*dcdc_fac - k_r[85];
        J[640] += -1 * dqdci;         /* dwdot[H]/d[C2H6] */
        J[654] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H6] */
        J[656] += 1 * dqdci;          /* dwdot[C2H6]/d[C2H6] */
        /* d()/d[CO2] */
        dqdci = dcdc_fac;
        J[880] += -1 * dqdci;         /* dwdot[H]/d[CO2] */
        J[894] += -1 * dqdci;         /* dwdot[C2H5]/d[CO2] */
        J[896] += 1 * dqdci;          /* dwdot[C2H6]/d[CO2] */
    } else {
        dqdc[0] = dcdc_fac + k_f[85] *sc[14];
        dqdc[1] = 2*dcdc_fac;
        dqdc[2] = dcdc_fac;
        dqdc[3] = dcdc_fac;
        dqdc[4] = dcdc_fac;
        dqdc[5] = dcdc_fac;
        dqdc[6] = 2*dcdc_fac;
        dqdc[7] = dcdc_fac;
        dqdc[8] = 6*dcdc_fac;
        dqdc[9] = dcdc_fac;
        dqdc[10] = dcdc_fac;
        dqdc[11] = 1.5*dcdc_fac;
        dqdc[12] = dcdc_fac;
        dqdc[13] = dcdc_fac;
        dqdc[14] = dcdc_fac + k_f[85] *sc[0];
        dqdc[15] = dcdc_fac;
        dqdc[16] = 3*dcdc_fac - k_r[85];
        dqdc[17] = dcdc_fac;
        dqdc[18] = dcdc_fac;
        dqdc[19] = dcdc_fac;
        dqdc[20] = dcdc_fac;
        dqdc[21] = dcdc_fac;
        dqdc[22] = 2*dcdc_fac;
        dqdc[23] = dcdc_fac;
        dqdc[24] = dcdc_fac;
        dqdc[25] = dcdc_fac;
        dqdc[26] = dcdc_fac;
        dqdc[27] = dcdc_fac;
        dqdc[28] = dcdc_fac;
        dqdc[29] = dcdc_fac;
        dqdc[30] = dcdc_fac;
        dqdc[31] = dcdc_fac;
        dqdc[32] = dcdc_fac;
        dqdc[33] = dcdc_fac;
        dqdc[34] = dcdc_fac;
        dqdc[35] = dcdc_fac;
        dqdc[36] = dcdc_fac;
        dqdc[37] = dcdc_fac;
        dqdc[38] = dcdc_fac;
        for (int k=0; k<39; ++k) {
            J[40*k+0] += -1 * dqdc[k];
            J[40*k+14] += -1 * dqdc[k];
            J[40*k+16] += 1 * dqdc[k];
        }
    }
    J[1560] += -1 * dqdT; /* dwdot[H]/dT */
    J[1574] += -1 * dqdT; /* dwdot[C2H5]/dT */
    J[1576] += 1 * dqdT; /* dwdot[C2H6]/dT */

    /*reaction 87: C2H5 + H <=> C2H4 + H2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[86]);
    /* rate of progress */
    q = k_f[86]*phi_f[86] - k_r[86]*phi_r[86];
    dqdT = dlnkfdT[86]*k_f[86]*phi_f[86] - dkrdT[86]*phi_r[86];
    /* update wdot */
    wdot[0] -= q; /* H */
    wdot[1] += q; /* H2 */
    wdot[12] += q; /* C2H4 */
    wdot[14] -= q; /* C2H5 */
    /* d()/d[H] */
    dqdci =  + k_f[86] *sc[14];
    J[0] += -1 * dqdci;           /* dwdot[H]/d[H] */
    J[1] += 1 * dqdci;            /* dwdot[H2]/d[H] */
    J[12] += 1 * dqdci;           /* dwdot[C2H4]/d[H] */
    J[14] += -1 * dqdci;          /* dwdot[C2H5]/d[H] */
    /* d()/d[H2] */
    dqdci =  - k_r[86]*sc[12];
    J[40] += -1 * dqdci;          /* dwdot[H]/d[H2] */
    J[41] += 1 * dqdci;           /* dwdot[H2]/d[H2] */
    J[52] += 1 * dqdci;           /* dwdot[C2H4]/d[H2] */
    J[54] += -1 * dqdci;          /* dwdot[C2H5]/d[H2] */
    /* d()/d[C2H4] */
    dqdci =  - k_r[86]*sc[1];
    J[480] += -1 * dqdci;         /* dwdot[H]/d[C2H4] */
    J[481] += 1 * dqdci;          /* dwdot[H2]/d[C2H4] */
    J[492] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H4] */
    J[494] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H4] */
    /* d()/d[C2H5] */
    dqdci =  + k_f[86] *sc[0];
    J[560] += -1 * dqdci;         /* dwdot[H]/d[C2H5] */
    J[561] += 1 * dqdci;          /* dwdot[H2]/d[C2H5] */
    J[572] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H5] */
    J[574] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H5] */
    /* d()/dT */
    J[1560] += -1 * dqdT;         /* dwdot[H]/dT */
    J[1561] += 1 * dqdT;          /* dwdot[H2]/dT */
    J[1572] += 1 * dqdT;          /* dwdot[C2H4]/dT */
    J[1574] += -1 * dqdT;         /* dwdot[C2H5]/dT */

    /*reaction 88: C2H5 + O <=> CH3 + CH2O */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[87]);
    /* rate of progress */
    q = k_f[87]*phi_f[87] - k_r[87]*phi_r[87];
    dqdT = dlnkfdT[87]*k_f[87]*phi_f[87] - dkrdT[87]*phi_r[87];
    /* update wdot */
    wdot[4] += q; /* CH3 */
    wdot[5] -= q; /* O */
    wdot[14] -= q; /* C2H5 */
    wdot[15] += q; /* CH2O */
    /* d()/d[CH3] */
    dqdci =  - k_r[87]*sc[15];
    J[164] += 1 * dqdci;          /* dwdot[CH3]/d[CH3] */
    J[165] += -1 * dqdci;         /* dwdot[O]/d[CH3] */
    J[174] += -1 * dqdci;         /* dwdot[C2H5]/d[CH3] */
    J[175] += 1 * dqdci;          /* dwdot[CH2O]/d[CH3] */
    /* d()/d[O] */
    dqdci =  + k_f[87] *sc[14];
    J[204] += 1 * dqdci;          /* dwdot[CH3]/d[O] */
    J[205] += -1 * dqdci;         /* dwdot[O]/d[O] */
    J[214] += -1 * dqdci;         /* dwdot[C2H5]/d[O] */
    J[215] += 1 * dqdci;          /* dwdot[CH2O]/d[O] */
    /* d()/d[C2H5] */
    dqdci =  + k_f[87] *sc[5];
    J[564] += 1 * dqdci;          /* dwdot[CH3]/d[C2H5] */
    J[565] += -1 * dqdci;         /* dwdot[O]/d[C2H5] */
    J[574] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H5] */
    J[575] += 1 * dqdci;          /* dwdot[CH2O]/d[C2H5] */
    /* d()/d[CH2O] */
    dqdci =  - k_r[87]*sc[4];
    J[604] += 1 * dqdci;          /* dwdot[CH3]/d[CH2O] */
    J[605] += -1 * dqdci;         /* dwdot[O]/d[CH2O] */
    J[614] += -1 * dqdci;         /* dwdot[C2H5]/d[CH2O] */
    J[615] += 1 * dqdci;          /* dwdot[CH2O]/d[CH2O] */
    /* d()/dT */
    J[1564] += 1 * dqdT;          /* dwdot[CH3]/dT */
    J[1565] += -1 * dqdT;         /* dwdot[O]/dT */
    J[1574] += -1 * dqdT;         /* dwdot[C2H5]/dT */
    J[1575] += 1 * dqdT;          /* dwdot[CH2O]/dT */

    /*reaction 89: C2H5 + O2 <=> C2H4 + HO2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[88]);
    /* rate of progress */
    q = k_f[88]*phi_f[88] - k_r[88]*phi_r[88];
    dqdT = dlnkfdT[88]*k_f[88]*phi_f[88] - dkrdT[88]*phi_r[88];
    /* update wdot */
    wdot[12] += q; /* C2H4 */
    wdot[14] -= q; /* C2H5 */
    wdot[19] -= q; /* O2 */
    wdot[20] += q; /* HO2 */
    /* d()/d[C2H4] */
    dqdci =  - k_r[88]*sc[20];
    J[492] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H4] */
    J[494] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H4] */
    J[499] += -1 * dqdci;         /* dwdot[O2]/d[C2H4] */
    J[500] += 1 * dqdci;          /* dwdot[HO2]/d[C2H4] */
    /* d()/d[C2H5] */
    dqdci =  + k_f[88] *sc[19];
    J[572] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H5] */
    J[574] += -1 * dqdci;         /* dwdot[C2H5]/d[C2H5] */
    J[579] += -1 * dqdci;         /* dwdot[O2]/d[C2H5] */
    J[580] += 1 * dqdci;          /* dwdot[HO2]/d[C2H5] */
    /* d()/d[O2] */
    dqdci =  + k_f[88] *sc[14];
    J[772] += 1 * dqdci;          /* dwdot[C2H4]/d[O2] */
    J[774] += -1 * dqdci;         /* dwdot[C2H5]/d[O2] */
    J[779] += -1 * dqdci;         /* dwdot[O2]/d[O2] */
    J[780] += 1 * dqdci;          /* dwdot[HO2]/d[O2] */
    /* d()/d[HO2] */
    dqdci =  - k_r[88]*sc[12];
    J[812] += 1 * dqdci;          /* dwdot[C2H4]/d[HO2] */
    J[814] += -1 * dqdci;         /* dwdot[C2H5]/d[HO2] */
    J[819] += -1 * dqdci;         /* dwdot[O2]/d[HO2] */
    J[820] += 1 * dqdci;          /* dwdot[HO2]/d[HO2] */
    /* d()/dT */
    J[1572] += 1 * dqdT;          /* dwdot[C2H4]/dT */
    J[1574] += -1 * dqdT;         /* dwdot[C2H5]/dT */
    J[1579] += -1 * dqdT;         /* dwdot[O2]/dT */
    J[1580] += 1 * dqdT;          /* dwdot[HO2]/dT */

    /*reaction 90: C2H5 + C2H5 <=> C2H4 + C2H6 */
    /*a non-third-body and non-pressure-fall-off reaction */
    Ri = &(R[89]);
    /* rate of progress */
    q = k_f[89]*phi_f[89] - k_r[89]*phi_r[89];
    dqdT = dlnkfdT[89]*k_f[89]*phi_f[89] - dkrdT[89]*phi_r[89];
    /* update wdot */
    wdot[12] += q; /* C2H4 */
    wdot[14] -= 2 * q; /* C2H5 */
    wdot[16] += q; /* C2H6 */
    /* d()/d[C2H4] */
    dqdci =  - k_r[89]*sc[16];
    J[492] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H4] */
    J[494] += -2 * dqdci;         /* dwdot[C2H5]/d[C2H4] */
    J[496] += 1 * dqdci;          /* dwdot[C2H6]/d[C2H4] */
    /* d()/d[C2H5] */
    dqdci =  + k_f[89] *2*sc[14];
    J[572] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H5] */
    J[574] += -2 * dqdci;         /* dwdot[C2H5]/d[C2H5] */
    J[576] += 1 * dqdci;          /* dwdot[C2H6]/d[C2H5] */
    /* d()/d[C2H6] */
    dqdci =  - k_r[89]*sc[12];
    J[652] += 1 * dqdci;          /* dwdot[C2H4]/d[C2H6] */
    J[654] += -2 * dqdci;         /* dwdot[C2H5]/d[C2H6] */
    J[656] += 1 * dqdci;          /* dwdot[C2H6]/d[C2H6] */
    /* d()/dT */
    J[1572] += 1 * dqdT;          /* dwdot[C2H4]/dT */
    J[1574] += -2 * dqdT;         /* dwdot[C2H5]/dT */
    J[1576] += 1 * dqdT;          /* dwdot[C2H6]/dT */

    /*reaction 91: C2H5 + HCO <=> C2H6 + CO */
