    /*reaction 112: CH2 + H (+M) <=> CH3 (+M) */
    /*a pressure-fall-off reaction */
    Ri = &(R[111]);
    /* 3-body correction factor */
    alpha = mixture + sc[1] + 5*sc[8] + sc[6] + 0.5*sc[11] + sc[22] + 2*sc[16];
    /* pressure-fall-off */
