        Kc_save[29] = exp((g_RT[13] + g_RT[7]) - (g_RT[11] + g_RT[8]));
        Kc_save[30] = exp((g_RT[13] + g_RT[5]) - (g_RT[22] + g_RT[0]));
        Kc_save[31] = refC * exp((g_RT[13] + g_RT[20]) - (g_RT[22] + g_RT[7] + g_RT[0]));
        Kc_save[32] = refC * exp((g_RT[13] + g_RT[13]) - (g_RT[1] + g_RT[11] + g_RT[11]));
        Kc_save[33] = exp((g_RT[13] + g_RT[4]) - (g_RT[11] + g_RT[6]));
        Kc_save[34] = exp((g_RT[13] + g_RT[13]) - (g_RT[15] + g_RT[11]));
        Kc_save[35] = refC * exp((g_RT[15]) - (g_RT[13] + g_RT[0]));
        Kc_save[36] = refC * exp((g_RT[15]) - (g_RT[11] + g_RT[1]));
        Kc_save[37] = exp((g_RT[15] + g_RT[0]) - (g_RT[13] + g_RT[1]));
        Kc_save[38] = exp((g_RT[15] + g_RT[5]) - (g_RT[13] + g_RT[7]));
        Kc_save[39] = exp((g_RT[15] + g_RT[7]) - (g_RT[13] + g_RT[8]));
        Kc_save[40] = exp((g_RT[15] + g_RT[19]) - (g_RT[13] + g_RT[20]));
        Kc_save[41] = exp((g_RT[15] + g_RT[20]) - (g_RT[13] + g_RT[21]));
        Kc_save[42] = exp((g_RT[15] + g_RT[4]) - (g_RT[13] + g_RT[6]));
        Kc_save[43] = exp((g_RT[4] + g_RT[5]) - (g_RT[15] + g_RT[0]));
        Kc_save[44] = exp((g_RT[4] + g_RT[19]) - (g_RT[18] + g_RT[5]));
