    /*reaction 40: CH2O + OH <=> HCO + H2O */
    kc[39] = exp((g_RT[15] + g_RT[7]) - (g_RT[13] + g_RT[8]));

    /*reaction 41: CH2O + O2 <=> HCO + HO2 */
    kc[40] = exp((g_RT[15] + g_RT[19]) - (g_RT[13] + g_RT[20]));

    /*reaction 42: CH2O + HO2 <=> HCO + H2O2 */
    kc[41] = exp((g_RT[15] + g_RT[20]) - (g_RT[13] + g_RT[21]));

    /*reaction 43: CH2O + CH3 <=> HCO + CH4 */
    kc[42] = exp((g_RT[15] + g_RT[4]) - (g_RT[13] + g_RT[6]));

    /*reaction 44: CH3 + O <=> CH2O + H */
    kc[43] = exp((g_RT[4] + g_RT[5]) - (g_RT[15] + g_RT[0]));

    /*reaction 45: CH3 + O2 <=> CH3O + O */
    kc[44] = exp((g_RT[4] + g_RT[19]) - (g_RT[18] + g_RT[5]));

    /*reaction 46: CH3 + O2 <=> CH2O + OH */
    kc[45] = exp((g_RT[4] + g_RT[19]) - (g_RT[15] + g_RT[7]));

    /*reaction 47: CH3 + HO2 <=> CH3O + OH */
    kc[46] = exp((g_RT[4] + g_RT[20]) - (g_RT[18] + g_RT[7]));

    /*reaction 48: CH3 + CH3 (+M) <=> C2H6 (+M) */
    kc[47] = 1.0 / (refC) * exp((g_RT[4] + g_RT[4]) - (g_RT[16]));

    /*reaction 49: CH3 + H (+M) <=> CH4 (+M) */
    kc[48] = 1.0 / (refC) * exp((g_RT[4] + g_RT[0]) - (g_RT[6]));

    /*reaction 50: CH4 + H <=> CH3 + H2 */
    kc[49] = exp((g_RT[6] + g_RT[0]) - (g_RT[4] + g_RT[1]));

    /*reaction 51: CH4 + O <=> CH3 + OH */
    kc[50] = exp((g_RT[6] + g_RT[5]) - (g_RT[4] + g_RT[7]));

    /*reaction 52: CH4 + OH <=> CH3 + H2O */
    kc[51] = exp((g_RT[6] + g_RT[7]) - (g_RT[4] + g_RT[8]));

    /*reaction 53: CH3 + HO2 <=> CH4 + O2 */
    kc[52] = exp((g_RT[4] + g_RT[20]) - (g_RT[6] + g_RT[19]));

    /*reaction 54: CH4 + HO2 <=> CH3 + H2O2 */
    kc[53] = exp((g_RT[6] + g_RT[20]) - (g_RT[4] + g_RT[21]));

    /*reaction 55: CH2OH + M <=> CH2O + H + M */
    kc[54] = refC * exp((g_RT[17]) - (g_RT[15] + g_RT[0]));

    /*reaction 56: CH2OH + H <=> CH2O + H2 */
    kc[55] = exp((g_RT[17] + g_RT[0]) - (g_RT[15] + g_RT[1]));

    /*reaction 57: CH2OH + H <=> CH3 + OH */
